import React, { useEffect } from "react";

const Timer = () => {
  const [state, setState] = React.useState("00:00");

  const changeTick = (): void => {
    setState("02:00");
  };

  useEffect(() => {});

  return (
    <>
      <h3>{state}</h3>
      <button onClick={() => changeTick}>Click</button>
    </>
  );
};

export default Timer;
